import Playas from './data/playa.json'

const Single = () => {

     const currentRoute = window.location.pathname;
     const playas = Playas.find(it => currentRoute.includes(it.slug))

     return (<>
         <center><h1>{playas.name}</h1></center>
           <hr></hr>
           <img src={playas.picture} alt={playas.name} style={{ marginBottom: '20px' }} ></img> 
           <center><p>{playas.description}</p></center>

     </>);

}

export default Single;
